Вижу! Проблема в том, что API Dadata возвращает структуру:

```json
{
  "success": true,
  "data": {
    "cleaned": cleanedAddress,  // весь объект
    "city_fias_id": cleanedAddress.city_fias_id  // дублируем для удобства
  }
}
```

Но в функции `getCityFiasFromAddress` мы обращаемся к `data.data.cleaned.city_fias_id`, что правильно. Проблема в том, что мы проверяем `data.data?.cleaned`, но в ответе есть `data.data.cleaned` (это объект с полями).

